  false,\n\t\"url\": null,\n\t\"notes\": \"The Lower Souris Migratory Waterfowl Refuge
  (now known as the J. Clark Salyer National Wildlife Refuge) is located just south
  of the Canadian border in North Dakota. The refuge was established and constructed
  by the CCC in 1935 to restore waterfowl habitat. This report gives an overview of
  events taking place on the refuge in March of 1938. The month was relatively dry,
  posing little hope for good spring runoff. The migration came early due to the abnormally
  warm weather. A table of migration records is included in the report. Predator control
  operations have been reduced and are focused at the nesting areas. Fencing projects
  got a head start due to the early spring. Island graveling work was completed with
  the completion of the second island. Other miscellaneous projects included fence
  removal, rip-rap installation and boundary sign installment. The report is followed
  by a second document titled u201cBirds of the Lower Souris Refugeu201d and a photographs
  section.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
